import React, { Component } from "react";

const PersonalInfo = (props) => {
  const { personalInfos } = props;

  return(
    <ul>
      {personalInfos.map((personalInfo) => {
        return <li>{PersonalInfo.firstName}</li>;
    })}
    </ul>
  );
};

export default PersonalInfo;
